import React from "react";
import Home from "./Components/Home";
import Input from "./Components/Input";
import { Route } from "react-router-dom";
import './App.css';

function App() {
  return (
    <div className="App">
      <Route path="/home"><Home /></Route>
      <Route path="/input"><Input /></Route>

    </div>
  );
}

export default App;
